  <div className="row ml-2">


  {notes.map((note) => {
    return (
      <div className="col-xs-3-md-2 m-3"  key={note.id}>
        <div className="card rounded" style={{width: "18rem"}}>
        <div className="card-body">
          <p className="card-text">{note.text}</p>
          <button className="btn btn-outline-danger float-right" onClick={deleteNotes(note.id)}><i className="fa fa-trash" aria-hidden="true"></i></button>

        </div>

      </div>
       </div>

    );
  })}
</div>
</div>
    )
}

